(6, 'Winter.Blog', 'comment', '1.0.2', 'Added the processed HTML content column to the posts table.', '2022-09-18 20:34:51'),
(7, 'Winter.Blog', 'comment', '1.0.3', 'Category component has been merged with Posts component.', '2022-09-18 20:34:51'),
(8, 'Winter.Blog', 'comment', '1.0.4', 'Improvements to the Posts list management UI.', '2022-09-18 20:34:51'),
(9, 'Winter.Blog', 'comment', '1.0.5', 'Removes the Author column from blog post list.', '2022-09-18 20:34:51'),
(10, 'Winter.Blog', 'comment', '1.0.6', 'Featured images now appear in the Post component.', '2022-09-18 20:34:51'),
(11, 'Winter.Blog', 'comment', '1.0.7', 'Added support for the Static Pages menus.', '2022-09-18 20:34:51'),
(12, 'Winter.Blog', 'comment', '1.0.8', 'Added total posts to category list.', '2022-09-18 20:34:51'),
(13, 'Winter.Blog', 'comment', '1.0.9', 'Added support for the Sitemap plugin.', '2022-09-18 20:34:51'),
(14, 'Winter.Blog', 'comment', '1.0.10', 'Added permission to prevent users from seeing posts they did not create.', '2022-09-18 20:34:51'),
(15, 'Winter.Blog', 'comment', '1.0.11', 'Deprecate \"idParam\" component property in favour of \"slug\" property.', '2022-09-18 20:34:51'),
(16, 'Winter.Blog', 'comment', '1.0.12', 'Fixes issue where images cannot be uploaded caused by latest Markdown library.', '2022-09-18 20:34:51'),
(17, 'Winter.Blog', 'comment', '1.0.13', 'Fixes problem with providing pages to Sitemap and Pages plugins.', '2022-09-18 20:34:51'),
(18, 'Winter.Blog', 'comment', '1.0.14', 'Add support for CSRF protection feature added to core.', '2022-09-18 20:34:51'),
(19, 'Winter.Blog', 'comment', '1.1.0', 'Replaced the Post editor with the new core Markdown editor.', '2022-09-18 20:34:51'),
(20, 'Winter.Blog', 'comment', '1.1.1', 'Posts can now be imported and exported.', '2022-09-18 20:34:51'),
(21, 'Winter.Blog', 'comment', '1.1.2', 'Posts are no longer visible if the published date has not passed.', '2022-09-18 20:34:51'),
(22, 'Winter.Blog', 'comment', '1.1.3', 'Added a New Post shortcut button to the blog menu.', '2022-09-18 20:34:51'),
(23, 'Winter.Blog', 'script', '1.2.0', 'v1.2.0/categories_add_nested_fields.php', '2022-09-18 20:34:51'),
(24, 'Winter.Blog', 'comment', '1.2.0', 'Categories now support nesting.', '2022-09-18 20:34:51'),
(25, 'Winter.Blog', 'comment', '1.2.1', 'Post slugs now must be unique.', '2022-09-18 20:34:51'),
(26, 'Winter.Blog', 'comment', '1.2.2', 'Fixes issue on new installs.', '2022-09-18 20:34:51'),
(27, 'Winter.Blog', 'comment', '1.2.3', 'Minor user interface update.', '2022-09-18 20:34:51'),
(28, 'Winter.Blog', 'script', '1.2.4', 'v1.2.4/update_timestamp_nullable.php', '2022-09-18 20:34:51'),
(29, 'Winter.Blog', 'comment', '1.2.4', 'Database maintenance. Updated all timestamp columns to be nullable.', '2022-09-18 20:34:51'),
(30, 'Winter.Blog', 'comment', '1.2.5', 'Added translation support for blog posts.', '2022-09-18 20:34:51'),
(31, 'Winter.Blog', 'comment', '1.2.6', 'The published field can now supply a time with the date.', '2022-09-18 20:34:51'),
(32, 'Winter.Blog', 'comment', '1.2.7', 'Introduced a new RSS feed component.', '2022-09-18 20:34:51'),
(33, 'Winter.Blog', 'comment', '1.2.8', 'Fixes issue with translated `content_html` attribute on blog posts.', '2022-09-18 20:34:51'),
(34, 'Winter.Blog', 'comment', '1.2.9', 'Added translation support for blog categories.', '2022-09-18 20:34:51'),
(35, 'Winter.Blog', 'comment', '1.2.10', 'Added translation support for post slugs.', '2022-09-18 20:34:51'),
(36, 'Winter.Blog', 'comment', '1.2.11', 'Fixes bug where excerpt is not translated.', '2022-09-18 20:34:51'),
(37, 'Winter.Blog', 'comment', '1.2.12', 'Description field added to category form.', '2022-09-18 20:34:51'),
(38, 'Winter.Blog', 'comment', '1.2.13', 'Improved support for Static Pages menus, added a blog post and all blog posts.', '2022-09-18 20:34:51'),
(39, 'Winter.Blog', 'comment', '1.2.14', 'Added post exception property to the post list component, useful for showing related posts.', '2022-09-18 20:34:51'),
(40, 'Winter.Blog', 'comment', '1.2.15', 'Back-end navigation sort order updated.', '2022-09-18 20:34:52'),
(41, 'Winter.Blog', 'comment', '1.2.16', 'Added `nextPost` and `previousPost` to the blog post component.', '2022-09-18 20:34:52'),
(42, 'Winter.Blog', 'comment', '1.2.17', 'Improved the next and previous logic to sort by the published date.', '2022-09-18 20:34:52'),
(43, 'Winter.Blog', 'comment', '1.2.18', 'Minor change to internals.', '2022-09-18 20:34:52'),
(44, 'Winter.Blog', 'comment', '1.2.19', 'Improved support for Build 420+', '2022-09-18 20:34:52'),
(45, 'Winter.Blog', 'script', '1.3.0', 'v1.3.0/posts_add_metadata.php', '2022-09-18 20:34:52'),
(46, 'Winter.Blog', 'comment', '1.3.0', 'Added metadata column for plugins to store data in', '2022-09-18 20:34:52'),
(47, 'Winter.Blog', 'comment', '1.3.1', 'Fixed metadata column not being jsonable', '2022-09-18 20:34:52'),
(48, 'Winter.Blog', 'comment', '1.3.2', 'Allow custom slug name for components, add 404 handling for missing blog posts, allow exporting of blog images.', '2022-09-18 20:34:52'),
(49, 'Winter.Blog', 'comment', '1.3.3', 'Fixed \'excluded categories\' filter from being run when value is empty.', '2022-09-18 20:34:52'),
(50, 'Winter.Blog', 'comment', '1.3.4', 'Allow post author to be specified. Improved translations.', '2022-09-18 20:34:52'),
(51, 'Winter.Blog', 'comment', '1.3.5', 'Fixed missing user info from breaking initial seeder in migrations. Fixed a PostgreSQL issue with blog exports.', '2022-09-18 20:34:52'),
(52, 'Winter.Blog', 'comment', '1.3.6', 'Improved French translations.', '2022-09-18 20:34:52'),
(53, 'Winter.Blog', 'comment', '1.4.0', 'Stability improvements. Rollback custom slug names for components', '2022-09-18 20:34:52'),
(54, 'Winter.Blog', 'comment', '1.4.1', 'Fixes potential security issue with unsafe Markdown. Allow blog bylines to be translated.', '2022-09-18 20:34:52'),
(55, 'Winter.Blog', 'comment', '1.4.2', 'Fix 404 redirects for missing blog posts. Assign current category to the listed posts when using the Posts component on a page with the category parameter available.', '2022-09-18 20:34:52'),
(56, 'Winter.Blog', 'comment', '1.4.3', 'Fixes incompatibility with locale switching when plugin is used in conjunction with the Translate plugin. Fixes undefined category error.', '2022-09-18 20:34:52'),
(57, 'Winter.Blog', 'comment', '1.4.4', 'Rollback translated bylines, please move or override the default component markup instead.', '2022-09-18 20:34:52'),
(58, 'Winter.Blog', 'comment', '1.5.0', 'Implement support for October CMS v2.0', '2022-09-18 20:34:52'),
(59, 'Winter.Blog', 'script', '2.0.0', 'v2.0.0/rename_tables.php', '2022-09-18 20:34:52'),
(60, 'Winter.Blog', 'comment', '2.0.0', 'Rebrand to Winter.Blog', '2022-09-18 20:34:52');
